import "./pop-up-input-valid.css";

const PopUpInputValid = (props) => {
  const closePopUpHandler = () => {
    props.closePopUpFlag(true);
  }

  return (
    <div className="pop-up-input__valid" onClickCapture={closePopUpHandler}>
      <div className="pop-up-input__valid-body">
        <div className="div-pop">
          <h3 className="pop-up-input__valid-title">Некорректный ввод</h3>
        </div>
        <div className="pop-up-input__valid-text">
          <p>Эти поля не могут быть пустыми!</p>
        </div>
        <div>
          <button className="pop-up-input__valid-button" type="button" onClick={closePopUpHandler}>Закрыть</button>
        </div>
      </div>
    </div>
  )
}

export default PopUpInputValid;
